    &amp;sup2;&amp;sup3;                      Invader ZIM is an eccentric alien soldier from the             &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      planet Irk. He was banished from the Irken Empire              &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      after nearly destroying his home planet on an early            &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      mission. After begging his superiors, the Almighty             &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      Tallest Red and Purple, for another chance, they               &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      decide to get rid of him once and for all. They trick          &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      him into going on a &quot;secret mission&quot; to an obscure             &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      planet at the edge of the universe, a planet with the          &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      unlikely name of Earth. Their trick works, and now             &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      ZIM is intent on bringing down the human race. He              &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      disguises himself as a schoolboy, and now the only             &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      person who can stop him is one kid - Dib Membrane, a           &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      somewhat insane paranormal researcher, who sees                &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      straight through ZIM's disguise and is intent on               &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      stopping his reign of terror. But neither ZIM nor Dib          &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      is very good at their job, and what results is                 &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      everything imaginable, from a giant hamster                    &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      destroying the city to both ZIM and Dib being turned           &amp;sup3;&amp;plusmn;
    &amp;sup2;&amp;sup3;                      into bologna meat.                                             &amp;sup3;&amp;plusmn;
